import React from 'react'
import img from "../SourceFiles/Header/male.png";

function MentorShow(props) {
    const {data} = props;
    return (
        <div id = 'mentor-data-container'>
        <div id = 'md-header'>
            <div id = 'md-header-flex' className = 'flex'>
                <hr id = 'md-header-hr-left'/>
                <img src = {img}/> 
                <h3>{data.name}</h3>
                <hr id = 'md-header-hr-right'/>
            </div>
        </div>
        <div id = 'md-content'>
            <div></div>
            <div id = 'md-main' className = 'flex'>
                <div id = 'md-main-conten'></div>
                <div id = 'md-main-skill'></div>
            </div>
            <hr/>
            <div id = 'md-text' >
                <h5>{data.text.textHeader}</h5>
                <p>{data.text.textContent}</p>
            </div>
            <hr/>
            <div id = 'md-galery'>
                    {data(item => {
                            return(
                            <ul className = 'flex'>
                                {item.galery.map(image => {
                                    return(
                                        <li className = 'flex'>
                                            <img src = {image} />
                                        </li>
                                    )
                                })}
                            </ul>
                        )
                    })}
            </div>
            <hr />
            <div id = 'md-sosial-media'>
                {
                    MentorList.map(mentor => {
                        if(mentor.id == MentorShow){
                            return(
                                <ul className = 'flex'>
                                    {mentor.sm.map(item => {
                                        return(
                                            <li className = {item.class}>
                                                <i className = {item.logo}></i>
                                                <h6>{item.name}</h6>
                                            </li>
                                        )
                                    })}
                                </ul>
                            )
                        }

                    })
                }
            </div>
        </div>
    </div>
    )
}

export default MentorShow
